import actionTypes from './appActionTypes';
export const set_hx_config = (value) => ({
    type: actionTypes.SET_HX_CONFIG,
    value
})
export const set_url_params = (value) => ({
    type: actionTypes.SET_URL_PARAMS,
    value
})
export const set_uid = (value) => ({
    type: actionTypes.SET_UID,
    value
})